import React from "react";

const MovieList = (props) =>{
    return(
        <div className="image-container">
            {props.movies.map((movie, index)=> <div>
                <img src={movie.Poster} alt='img'></img>
            </div>)}
        </div>
    )
}


export default MovieList;
